local cell = object.create("toplevel")

local comparator_sub = pcell.create_layout("analog/strongARM_comparator", "comparator_sub", {
	gatelength = 40, --100
	gatespace = 90,
	clockfingers = 4, --8
	inputfingers = 4, --4
	clockfwidth = 500,
	inputfwidth = 500,
	latchpfwidth = 500,
	latchnfwidth = 500,
	pfetvthtype = 3,
	sdwidth = 60,
	gstrwidth = 60,
	invgstrapwidth = 60,
	resetgatestrapwidth = 60,
	clockinputgatewidth = 60,
	nfetflippedwell = true
})

cell:merge_into_shallow(comparator_sub:flatten())

cell:add_port("VDD", generics.metalport(1), comparator_sub:get_anchor("vdd"))
cell:add_port("VSS", generics.metalport(1), comparator_sub:get_anchor("vss"))
cell:add_port("clk", generics.metalport(1), comparator_sub:get_anchor("clk"))
cell:add_port("vin+", generics.metalport(1), comparator_sub:get_anchor("vinp"))
cell:add_port("vin-", generics.metalport(1), comparator_sub:get_anchor("vinn"))
cell:add_port("vout+", generics.metalport(1), comparator_sub:get_anchor("voutp"))

return cell

